import React from 'react';
import { IonHeader, IonToolbar, IonButtons, IonTitle } from '@ionic/react';

import './index.css';

const scanDevices: React.FC = () => {
  return (
    <IonHeader class="main-header">
      <IonToolbar>
        <IonButtons slot="start">
        </IonButtons>
        <IonTitle>Scanning for devices...</IonTitle>
      </IonToolbar>
    </IonHeader>
  );
};

export default scanDevices;
